  false,\n\t\"url\": null,\n\t\"notes\": \"This data set describes the potential threat
  of sediment delivery and land-based sources of pollution to benthic habitats. This
  dataset is derived from NOAA's study, the Benthic Habitats of Puerto Rico and the
  U.S. Virgin Islands. The Benthic Habitats data is the result of a cooperative effort
  between NOAA's National Centers for Coastal Ocean Science (NCCOS), U.S. Geological
  Survey, National Park Service, and the National Geophysical Data Center, to produce
  benthic habitat maps and georeferenced imagery for Puerto Rico. This project was
  conducted in support of the U.S. Coral Reef Task Force.\",\n\t\"license_title\":
